- input: "TEXT\x1CC00432260\x1C.TEXT\x1C\x1CF3XA\x1CThis memo text is in response
    to the 3 items questioned in your letter dated 1/14/09.  Item 1: The aggregate
    y-t-d totals you questioned actually refer to the donor's contributions to CFG
    PAC, not to the candidate or committee referenced in the memo entry. As we discussed,
    the FECfile software does not allow us to edit this field and all the data was
    imported in the format shown on the instructions for the FECfile software.  Items
    2 and 3, which refer to a $2,300 bundled contribution listed on Schedule B but
    not on Schedule A; as well as a separate $2,300 bundled contribution listed on
    Schedule A, but not on Schedule B, are actually the same contribution. In the
    original report, a $2,300 contribution received on 6/23/08 was listed as an earmarked
    contribution for Wil Armstong for Congress (CO-6) on Schedule A.  This same contribution
    is shown as disbursed on Schedule B, on 6/25/08, as a $2,300 contribution, to
    Walberg for Congress (MI-7), thus making them appear as two separate transactions.
    \ Schedule B was mislabled as being earmarked for Walberg for Congress (MI-7),
    as it actually should have been attributed to Wil Armstong for Congress (CO-6).
    \ The entry has been corrected.  Also in reference to Item 3, the contribution
    from another political committee has been changed to the appropriate line (from
    11a to 11c)."
